Gangland Bangers (DvdRip / Classic / 1995) 

What is it about a gangster that makes him so attractive to the ladies? Could it be that distinct swagger in his walk? The toughness in his talk? Or perhaps it's that big rod he's always packing. Whatever the reason, Europe's most lauded director has tackled the allure of the mobster in this big-budget feature film, packed with the hottest talent the industry has to offer. So slip on your spats and get ready for a whole new kind of rat-a-tat-tat action - the kind where they don't shoot blanks!

Roxanne Hall, Juli Ashton, J.R. Carrington, Sophia Ferrari, Dallas, Gina Rome, Jenteal, Claudio, Frank Towers, Mark Davis, Sean Michaels, Steven St. Croix, Tony Montana, Vince Vouyer

Feature, European, Action, Historical, Anal, Hardcore

